@import "../shared/helper";

.home{flex: 1;height: 100%;display: flex;flex-direction: column;
   background: #010310; color: white;
   > header {
      height: px(99);
      background-size: cover;
   }
   >main { 
      padding-top: px(30);
      flex: 1;
      display: grid;
      grid-template:
         "box1 box2 box4 box5" 755fr
         "box3 box3 box4 box5" 363fr / 366fr 361fr 811fr 747fr;
      grid-column-gap: px(28);
      grid-row-gap: px(28);
      .bordered {
            border: 1px solid #0764bc;
            border-radius: 4px;
            position: relative;
            box-shadow: 0 0 2px 0 #0f3361, inset 0 0 2px 0 #0e325f;
            background: #0c1139;
            &::before{
               content: ' ';
               position: absolute;
               left: 0;
               right: 0;
               bottom: 0;
               top: 0;
               border-radius: 4px;
               box-shadow: 17px 0 0 -16px #0f3361,
               -17px 0 0 -16px #0f3361,
               0 17px 0 -16px #0f3361,
               0 -17px 0 -16px #0f3361,
               9px 0 0 -8px #0d4483,
               -9px 0 0 -8px #0d4483,
               0 9px 0 -8px #0d4483,
               0 -9px 0 -8px #0d4483,;
            }  
         }
         > .section1 {
         grid-area: box1;
      }
       > .section2 {
          grid-area: box2;
       }
      > .section3 {
          grid-area: box3;
      }
      > .section4 {
         grid-area: box4;
      }
      > .section5 {
         grid-area: box5;
      }
      .管辖统计{
         height: px(315);
         h2{
            border: 1px solid #0a5299;
            display: inline-block;
         }
      }
    }
   }
